import React, { Component } from 'react';
import './App.css';
import {Button, Cells, Cell, CellBody, CellFooter, ActionSheet, Toast, Gallery} from 'react-weui';
import ItemService from '../service/ItemService';
import JielongService from '../service/JielongService';
import AuthService from "../service/AuthService";
import Router from 'next/router';
import SiteHeader from '../components/Common/SiteHeader';
import Link from 'next/link';


//import styles
import 'weui';
import 'react-weui/build/packages/react-weui.css';


//import component
import Swipe from '../components/Swipe';
import Head from "../components/head";
import ProductCardGrid from "../components/ProductCards/ProductCardGrid";
import ChildrenList from '../components/JieLongDetails/ChildrenList';
import JielongContent from '../components/JieLongDetails/JieLongContent';
import Footer from "../components/Footer";
import Lang from '../lang/Lang';
import {Config} from "../Config";
import JieLongBanner from "../components/JieLongDetails/JieLongBanner";

class cartPage extends Component {
    constructor(props){
        super(props);
        this.state = {
        };
    }


    componentDidMount() {
        this.getItems();
    }

    getItems() {
        let params = this.state.item.company_id + '?is_draft=0&is_sync_to_market=1&page=1&page-size=6';
        ItemService.getItemDetail('0f95b4d63b1afa75c3a9e2b3fae27cdf')
            .then((response) => response.json())
            .then((responseJson) => {
                this.setState({
                    itemList: responseJson
                });
            })
            .catch((error) => {
                console.error(error);
            });
    }

    render() {
        const itemList = this.state.itemList;
        console.log(itemList);

        return (
            <div className="App">
                <SiteHeader/>
                <div className='App-body'>
                    <div style={styles.pageTitle}>{Lang.translate('CART')}</div>

                    <Footer/>

                </div>
            </div>

        );
    }
}const styles = {
    pageTitle: {
        fontSize:"16px",
        fontWeight:"bold",
        textAlign:"center",
    }
};

export default cartPage;
